FormAction.Script:
//First check whether the records has been selected or not in the table
                     var isValid = true;
                     var activitiesTable = thisForm.controlManager.getControlByName('tblActivities');
                     if (activitiesTable.selModel.selected.length === 0) {
                         var errorString = Forms.Common.Lang.GetLocaleString('BC1F3A07ACA8465197A752F600B45A61', true);
                         //show error message and return false
                         Forms.MessageHelper.Display(errorString);
                         isValid = false;
                     }

                    //Check whether From and To resource id's are same?
                     if (isValid == true && thisForm.controlManager.getControlByName('resTreeReassignFrom').getValue() == thisForm.controlManager.getControlByName('resTreeReassignTo').getValue()) {
                         var errorMessage = Forms.Common.Lang.GetLocaleString('D45BD75FFB584E99B915119847409F8B', true);
                         Forms.MessageHelper.Display(errorMessage);
                         isValid = false;
                     }

                     thisForm.formVariables.getFormVariableByName('IsValid').value = isValid;

                    if (isValid) {
                         var selActivitiesTable = thisForm.controlManager.getControlByName('tempSelectedActivities');
                         selActivitiesTable.clearData();

                         for(var i= 0; i<activitiesTable.selModel.selected.length; i++)
                         {
                             var record = activitiesTable.selModel.selected.items[i].data;
                             selActivitiesTable.store.add({ 'NodeId': record.NodeId, "ActivityName": record.NodeName, "JobId": record.JobId, "epc": record.epc });
                         }
                     }

// If WQDef selected value is 'All' then set the value to empty else set the selected type name.
var wqId = thisForm.controlManager.getControlByName('drpListType').getValue();
if(wqId === '')
{
    thisForm.formVariables.getFormVariableByName('WqDefId').value = '';
}
else
{
var typeDropdown = thisForm.controlManager.getControlByName('drpListType');
var rec = typeDropdown.findRecord('Value', typeDropdown.getValue(), false, true, true);
thisForm.formVariables.getFormVariableByName('WqDefId').value =  rec.get('Text');
}

// If Version selected value is 'All' then set the value to 0 else set the process version
var version = thisForm.controlManager.getControlByName('drpListVersion').getValue();
if(version === '')
{
    thisForm.formVariables.getFormVariableByName('Version').value = 0;
}
else
{
 thisForm.formVariables.getFormVariableByName('Version').value = version;
}

// If Process selected value is 'All' then set the value to empty else set the process id
var processId = thisForm.controlManager.getControlByName('drpListProcess').getValue();
if(processId === '')
{
    thisForm.formVariables.getFormVariableByName('ProcessId').value = '';
}
else
{
 thisForm.formVariables.getFormVariableByName('ProcessId').value = processId;
}

// If Activity selected value is 'All' then set the value to empty else set the node name.
var nodeId = thisForm.controlManager.getControlByName('drpListActivity').getValue();
if(nodeId === '')
{
    thisForm.formVariables.getFormVariableByName('ActivityName').value = null;
}
else
{
var activityDropdown = thisForm.controlManager.getControlByName('drpListActivity');
var rec = activityDropdown.findRecord('Value', activityDropdown.getValue(), false, true, true);

 thisForm.formVariables.getFormVariableByName('ActivityName').value = rec.get('Text');
}

var versionDropdown = thisForm.controlManager.getControlByName('drpListVersion');
var allVar = versionDropdown.findRecord('Value', '', 0, false, true, true);
//Remove the All from the list
versionDropdown.getStore().remove(allVar);

var firstVar = versionDropdown.store.getAt(0).get('Value');
// Select the first item in the list
versionDropdown.setValue(firstVar);
